import React from "react";

class Todoitem extends React.Component {
  render() {
    return (
      <div>
        <h1>{this.props.todo.Title}</h1>
        <h3>{this.props.todo.Status ? "completed" : "not completed"}</h3>
      </div>
    );
  }
}
export default Todoitem;
